import React from "react";
import { Navbar } from 'react-bootstrap';
import { Nav } from "react-bootstrap";
import { Form } from "react-bootstrap";
import { AiOutlineSearch } from 'react-icons/ai';
import { AiOutlineUser } from 'react-icons/ai';
import { AiOutlineShopping} from 'react-icons/ai';
import { FormControl } from "react-bootstrap";
import 'bootstrap/dist/css/bootstrap.min.css';
import "./css/navmenu.css";
import logo from "./images/NykaaLogoSvg.svg";

class NavMenu extends React.Component{
    render(){
        return(
            <div>
                <div class="conatiner-fluid">
                <nav>
                    <Navbar class="navbar" expand="lg">
                        <Navbar.Brand id="brand" href="#home"><img src={logo} alt="logo" ></img></Navbar.Brand>
                        <Navbar.Toggle aria-controls="basic-navbar-nav" />
                        <Navbar.Collapse id="basic-navbar-nav">
                            <Nav className="mr-auto">
                            <Nav.Link className="linkText" href="#home">CATEGORIES</Nav.Link>
                            <Nav.Link className="linkText" href="#link">BRANDS</Nav.Link>
                            <Nav.Link className="linkText" href="#link">NYKAA FASHION</Nav.Link>
                            <Nav.Link className="linkText" href="#link">BEAUTY ADVICE</Nav.Link>
                            <Nav.Link className="linkText" href="#link">NYKAA NETWORK</Nav.Link>
                            </Nav>
                            <div class="form-group has-search">
    <span class="fa fa-search form-control-feedback"></span>
    <input type="text" class="form-control" placeholder="Search" />
  </div>
  <div class="input-group">
    <input type="text" class="form-control" placeholder="Search this blog" />
    <div class="input-group-append">
      <button class="btn btn-secondary" type="button">
        <i class="fa fa-search"></i>
      </button>
    </div>
  </div>
                            <a href="App.js"><span class="icon"><AiOutlineUser size="15px"/>Account</span></a>
                            <a href="App.js"><span class="icon"><AiOutlineShopping size="15px"/></span></a>
                        </Navbar.Collapse>
                        </Navbar>
                    </nav>
                </div>
            </div>
)
    }
}
export default NavMenu;
